column3:
Rebir EM2-1500K-2 - міксер електричний для змішування будівельних розчинів, лакофарбових матеріалів, будівельного клею та інших сумішей. Потужний двошвидкісний двигун, укріплений корпус і високий крутний момент забезпечують інструменту надійність, якість виконуваних робіт і довгий термін служби.

Переваги будівельного міксера Rebir EM2-1500K-2:

два режими швидкості для роботи з різними по консистенції сумішами на високому рівні;
компактний алюмінієвий корпус забезпечує роботу без втоми тривалий час завдяки легкій вазі;
додаткова прогумована рукоятка дозволяє добре захопити інструмент і виконувати роботу в зручному положенні;
є можливість змінювати віночки для різних сумішей завдяки стандартній різьбі шпинделя М14;
кнопка включення фіксується у включеному положенні для безперервної роботи на стабільних оборотах. Кнопка захищена від пилу і бруду, що убезпечить користувача від заклинювання інстурумента;
триступеневий редуктор забезпечує надійність і якісне розмішування до 90 літрів за один раз.
Міксер Rebir EM2-1500K-2 комплектується:

віночком діаметром 160 мм;
додатковою рукояткою;
вугільними щітками - 2 шт.
Високопродуктивний будівельний міксер Rebir EM2-1500K-2 створить якісний розчин для подальших будівельних робіт.
